import React from "react";
import './phones.css'

const Mobile = ({mobiles}) => {
  return (
      <div>
          <h1>List of available phones</h1>
          {mobiles.map((x) => (
                  <div key={x.id}>
                      <div class="name"><h2>{x.name[0]} - {x.manufacturer[0]}</h2></div>
                      <div class="price"><h2>price: {x.price[0]}$</h2></div>
                  </div>
          ))}
      </div>

  )
};

export default Mobile
